import React from 'react';
import style from "./About.module.css";

function About() {
  return (
    <div>
      <h1>About</h1>
      <p>¡Hola! Soy Lucas Idiart, el creador de esta aplicación. Me gusta mucho Rick and Morty, así que decidí hacer esta pequeña app para mostrar algunos de mis personajes favoritos. Espero que la disfrutes tanto como yo disfruté haciéndola. ¡Gracias por usarla!</p>
      <span>Si quieren ver todos mis proyectos aquí les dejo el <a href="https://www.freecodecamp.org/espanol/Nemesis897">enlace</a></span>
    </div>
  );
}

export default About;
